import React from 'react';
import './App.css';
import Header from './components/Header.js';
import Slider from  './components/Slider.js';

function App() {
  return (
    <div>
      <Header/>
      <div style={{marginBottom: "200px"}}></div>
      <div className="container">
        <Slider/>
      </div>
    </div>
  );
}




export default App;
